import "./ExpenseData.css";

import ExpenseFilter from './ExpenseFilter';
import ExpenseChart from './ExpenseChart';
import ExpenseList from './ExpenseList';

const ExpenseData = () => {
  return (
    <div>
      <ExpenseFilter />
      <ExpenseChart />
      <ExpenseList />
    </div>
  );
};

export default ExpenseData;
